import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

export default function UserHome() {
  const navigate = useNavigate();
  const [isFileUpload, setIsFileUpload] = React.useState(localStorage.getItem("fileUpload") === "true");

  useEffect(() => {
    // Navigate based on localStorage value
    if (localStorage.getItem("fileUpload") === "true") {
      navigate("/userhome");
    }
  }, [navigate]);

  const email = localStorage.getItem('userEmail');

  return (
    <div>
      <Navbar />
      {isFileUpload ? <Upload userMail={email} /> : <Download />}
    </div>
  );
}
